import { NavbarHeader } from "./components/Header/Header";
import { Footer } from "./components/Footer/Footer";
import { RouteListComplete } from "./components/Routes/RouteList";


const App = () => {
  return (
    <main>
      <NavbarHeader />
        <RouteListComplete />
      <Footer/>
    </main>
  );
};
export default App;
